var varTypes=$('input:radio[name="varTypeId"]');for(i=1;i<=varTypes.length;i++){$('select[id="selectOpt_'+i+'"]').bootstrapDualListbox()}varTypes.click(function(){var b=$(this).val();var a=$("#dataGroup_"+b);var c="selectOpt_"+b;if(document.getElementById(c).options.length===0){$.ajax({url:listUrl+b,dataType:"json",type:"GET",success:function(e){var d=$('select[id="selectOpt_'+b+'"]');d.empty();$.each(e,function(f,h){var g="<option value='"+h.id+"'>"+h.name+"</option>";d.append(g)});d.bootstrapDualListbox("refresh",true)},error:function(f,d,e){alert("Unable to retrieve data list.")}})}$(".dataGroup").not(a).hide();a.show()});$(document).ready(function(){$('input:radio[name="varTypeId"]:checked').click()});